当商品はダクトレール専用の照明となります。<br><br>

【特長】<BR>
●ライティングレール上に自由に配置でき、照射角度も自在なので、理想の空間を演出できます。<BR>
●シンプルなデザインでどのようなシーンにも調和します。<BR><BR>

【仕様】<br>
スポットライト ライティングレール専用器具<BR>
※LED専用<br>
※使用可能電球径:φ80mm以下<br>
※口金規格:E26（電球別売）<br>
定格電圧：AC100V<br>
セード部サイズ:φ96×96ｘ200（mm）<br>
上下方向可動：:約90度<br>
回転方向可動：約350度<br>
材質：スチール、木<br> 
カラー：ブラウン/ナチュラル<br> 
重量：310（g）<br> 
1年間製品保証<br>
付属品：日本語取扱説明書 / 保証書<br><br>
取扱説明書のダウンロードはこちら 
